inline uint32_t get_sigsize(int bits, int dim, int errs) {
    if (8 < bits or 64 < dim) {
        std::cerr << "error: invalid bits or dim" << std::endl;
        exit(1);
    }
    return SIGSIZE[bits - 1][dim - 1][errs];
}

